import React from 'react';
// import './navigation.css';

const Navigation = ({onRouteChange, isSignedIn}) => {

  if (isSignedIn) {
    return (
          <div className = 'authenticate' >
              <nav className="navbar navbar-expand navbar-dark bg-dark">
                <img id="nav-logo" className="navbar-brand" src={require('../../img/alpha-nav.png')} alt="alpha-nav" />
                  // <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent" aria-expanded="false" aria-label="Toggle navigation">
                  //   <span className="navbar-toggler-icon"></span>
                  // </button>
                  <div className="collapse navbar-collapse" id="navbarToggleExternalContent">
                    <ul className="navbar-nav">
                      <li className="nav-item">
                        <a className="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
                      </li>
                      <li className="nav-item">
                        <a className="nav-link" onClick = {() => onRouteChange('signout')} >
                          Search
                        </a>
                      </li>
                      <li className="nav-item">
                        <a className="nav-link" onClick = {() => onRouteChange('signout')} >
                          Chat
                        </a>
                      </li>
                      <li className="nav-item">
                        <a className="nav-link" onClick = {() => onRouteChange('signout')} >
                          Sign Out
                        </a>
                      </li>
                   </ul>
                 </div>
              </nav>
          </div>
    );
  } else {
    return (
      <div className = 'authenticate' >
          <nav className="navbar navbar-expand navbar-dark bg-dark">
          <img id="nav-logo" className="navbar-brand" src={require('../../img/alpha-nav.png')} alt="alpha-nav" />

          // <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#options" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
          //      <span className="navbar-toggler-icon"></span>
          //    </button>
             <div className="collapse navbar-collapse" id="options">
               <ul className="navbar-nav mr-auto">
                 <li className="nav-item">
                     <a className="nav-link" onClick = {() => onRouteChange('signin')} >
                       Sign In
                     </a>
                </li>
                 <li className="nav-item">
                 <a className= "nav-link" onClick = {() => onRouteChange('register')} >
                   Register
                 </a>
                </li>
               </ul>
             </div>
          </nav>
      </div>

    );
  }
}


export default Navigation;
